import { useSelector } from "react-redux";

import Post from "./Post/Post";

const Posts = () => {
  const posts = useSelector(state => {
    state.posts;
  });

  //   console.log(posts);

  return (
    <>
      <h1>POSTS</h1>
      <Post />
    </>
  );
};

export default Posts;
